import React, { useState } from 'react';

const DatePicker = ({ onDateSelect }) => {
    const [period1, setPeriod1] = useState({ start: '2018-06-01', end: '2018-06-30' });
    const [period2, setPeriod2] = useState({ start: '2023-06-01', end: '2023-06-30' });
    const [isVisible, setIsVisible] = useState(true);

    const handleSubmit = (e) => {
        e.preventDefault();
        onDateSelect(
            period1.start, period1.end,
            period2.start, period2.end
        );
        setIsVisible(false);
    };

    return isVisible ? (
        <div className="date-picker-overlay">
            <div className="date-picker-modal">
                <h3>Compare Time Periods</h3>
                <form onSubmit={handleSubmit}>
                    <div className="period-section">
                        <h4>Baseline Period</h4>
                        <div className="date-input-group">
                            <label>Start Date:</label>
                            <input 
                                type="date" 
                                value={period1.start}
                                onChange={(e) => setPeriod1({...period1, start: e.target.value})}
                                max="2023-12-31"
                            />
                        </div>
                        <div className="date-input-group">
                            <label>End Date:</label>
                            <input 
                                type="date" 
                                value={period1.end}
                                onChange={(e) => setPeriod1({...period1, end: e.target.value})}
                                max="2023-12-31"
                            />
                        </div>
                    </div>

                    <div className="period-section">
                        <h4>Comparison Period</h4>
                        <div className="date-input-group">
                            <label>Start Date:</label>
                            <input 
                                type="date" 
                                value={period2.start}
                                onChange={(e) => setPeriod2({...period2, start: e.target.value})}
                                max="2023-12-31"
                            />
                        </div>
                        <div className="date-input-group">
                            <label>End Date:</label>
                            <input 
                                type="date" 
                                value={period2.end}
                                onChange={(e) => setPeriod2({...period2, end: e.target.value})}
                                max="2023-12-31"
                            />
                        </div>
                    </div>

                    <button type="submit">Analyze Changes</button>
                </form>
            </div>
        </div>
    ) : null;
};

export default DatePicker;
